import React from 'react';
import './JumboBanner.css';

const JumboBanner = () => {
  return (
    <div className="JumboBanner">
      <h4>Arizona's Quality Shop since 1979</h4>>
      <h1 className="TitleText">
        Mighty Muf'ler
      </h1>
      <h2 className="PhoneText">
        602-944-5210
      </h2>
    </div>
  );
}

export default JumboBanner;
